</div>

<ul  className="list">
{ingredients.map(ingredient =>(
<li > <img src="https://img.freepik.com/free-vector/whatsapp-double-check-design_23-2147900931.jpg?w=740&t=st=1670875816~exp=1670876416~hmac=3a6f2e3df6bcaded3a5232e3b59e6f9fbc34a4d0691dae680f9127289d679512" alt="icons" width='20px' /> {ingredient} </li>
))}
</ul>

<div className="container">
<p className="par"> {calories.toFixed()} calories </p>
</div>

</div>)
}

